import React, { useEffect } from 'react'
import axios from 'axios';

function LandingPage() {

  //LandingPage() 들어오자마자 실행한다
  useEffect(() => {
    axios.get('/api/hello')
    .then(response => console.log(response.data))
  }, [])

  return (
    <div>
      LandingPage
    </div>
  )
}

export default LandingPage
